import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const Header = () => {
    return ( 
     <Navbar sticky="top">
          <Container display="fluid">
               <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
               <Nav className="ml-auto">
                    <Nav.Link className="p-3" href="#home">Home</Nav.Link>
                    <Nav.Link className="p-3" href="#link">About</Nav.Link>
                    <Nav.Link className="p-3 btn login-btn" href="#home">Login</Nav.Link>
                    <Nav.Link className="p-3 btn signup-btn" href="#link">Sign Up</Nav.Link>
               </Nav>

          </Container>
     </Navbar>
     );
}

export default Header;
